$.widget("custom.catcomplete", $.ui.autocomplete, {
    _renderMenu: function(c, a) {
        var e = this,
            d = "";
        a = a.sort(function(a, b) {
            return a.Category < b.Category ? 1 : a.Category > b.Category ? -1 : 0
        });
        $.each(a, function(a, b) {
            b.Category != d && (c.append("<li class='ui-autocomplete-category' style=font-weight:bold;>" + b.Category + "</li>"), d = b.Category);
            e._renderItemData(c, b)
        })
    }
});